contracts/PresaleUpgradeable.sol.content:
//SPDX-License-Identifier: MIT

pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

interface IERC20_EXTENDED {
    function name() external view returns (string memory);

    function decimals() external view returns (uint256);
}

interface IStaking {
    function stakeByAdmin(
        address _userAddress,
        uint256 _value,
        uint256 _duration
    ) external returns (bool);
}

interface IReferral {
    function hasReferrer(address _address) external view returns (bool);

    function addReferrerAdmin(
        address _userAddress,
        address _referrerAddress
    ) external returns (bool);

    function payReferralETHAdmin(
        uint256 _value,
        address _userAddress,
        address _referrerAddress
    ) external returns (bool);

    function payReferralUSDAdmin(
        uint256 _value,
        address _userAddress,
        address _referrerAddress
    ) external returns (bool);

    function getLevelDecimals() external view returns (uint256);

    function getLevelRates()
        external
        view
        returns (
            uint256[] memory presale,
            uint256 totalRatePresale,
            uint256[] memory staking,
            uint256 totalRateStaking
        );

    function getUserReferrerAddress(
        address _address
    ) external view returns (address referrer);
}

contract PresaleUpgradeable is
    Initializable,
    OwnableUpgradeable,
    PausableUpgradeable,
    UUPSUpgradeable
{
    using SafeMathUpgradeable for uint256;

    address private _tokenSeller;
    address private _rewardOwner;

    address private _tokenContract;
    address private _stakingContract;
    address private _referralContract;
    address private _usdtContract;
    address private _rewardTokenContract;

    AggregatorV3Interface private _priceFeedOracleAddress;

    uint256 private _pricePerUSD;
    uint256 private _rewardPerUSD;
    uint256 private _minContributionUSD;

    uint256 private _totalTokenSold;
    uint256 private _totalETHRaised;
    uint256 private _totalUSDRaised;

    bool private _isBuyNStake;
    bool private _isPayReferral;
    bool private _isPayRewardTokens;

    receive() external payable {}

    event TokenPurchased(
        address indexed from,
        uint256 indexed tokenValue,
        uint256 indexed ethValue,
        string currency
    );

    event RewardTokenDistributed(
        address indexed to,
        uint256 indexed tokenValue,
        address indexed rewardTokenContract
    );

    function initialize() external initializer {
    _priceFeedOracleAddress = AggregatorV3Interface(
        0xAB594600376Ec9fD91F8e885dADF0CE036862dE0
    );

    _usdtContract = 0xc2132D05D31c914a87C6611C10748AEb04B58e8F;
    _tokenContract = 0x9C19247BD66F34e07c05beA8895D5D35dD49f253;
    _rewardTokenContract = 0x7F9fD63932babC508FAD2f324EB534D09cfE86F0;
    _referralContract;
    _stakingContract;

    _tokenSeller = 0xB35963E0AB2141cd4aB743e7a35d8772F3Cf0447;
    _rewardOwner = 0xf91e1eD00f015c6Be3FBc6b0d84fBaEF005ec5B5;

    _pricePerUSD = 8500000000000000000;
    _rewardPerUSD = 85000000000000000;

    _isPayReferral = true;
    _isBuyNStake = false;
    _isPayRewardTokens = true;

    _minContributionUSD = 20000000000000000000;

    __Pausable_init();
    __Ownable_init();
    __UUPSUpgradeable_init();
}

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}

    function getPriceFeedOracleAddress() external view returns (address) {
        return address(_priceFeedOracleAddress);
    }

    function setPriceFeedOracleAddressAdmin(
        address _address
    ) external onlyOwner returns (bool) {
        _priceFeedOracleAddress = AggregatorV3Interface(_address);
        return true;
    }

    function getTokenSeller() external view returns (address) {
        return _tokenSeller;
    }

    function setTokenSeller(address _address) external onlyOwner {
        _tokenSeller = _address;
    }

    function getRewardOwners() external view returns (address) {
        return _rewardOwner;
    }

    function setRewardOwner(address _address) external onlyOwner {
        _rewardOwner = _address;
    }

    function getTokenContract()
        external
        view
        returns (
            address tokenAddress,
            string memory name,
            uint256 decimals,
            uint256 totalSupply
        )
    {
        tokenAddress = _tokenContract;
        name = IERC20_EXTENDED(_tokenContract).name();
        decimals = IERC20_EXTENDED(_tokenContract).decimals();
        totalSupply = IERC20Upgradeable(_tokenContract).totalSupply();
    }

    function setTokenContractAdmin(
        address _address
    ) external onlyOwner returns (bool) {
        _tokenContract = _address;
        return true;
    }

    function getStakingContract() external view returns (address) {
        return _stakingContract;
    }

    function setStakingContractAdmin(
        address _address
    ) external onlyOwner returns (bool) {
        _stakingContract = _address;
        return true;
    }

    function getRewardTokenContract()
        external
        view
        returns (
            address tokenAddress,
            string memory name,
            uint256 decimals,
            uint256 totalSupply
        )
    {
        tokenAddress = _rewardTokenContract;
        name = IERC20_EXTENDED(_rewardTokenContract).name();
        decimals = IERC20_EXTENDED(_rewardTokenContract).decimals();
        totalSupply = IERC20Upgradeable(_rewardTokenContract).totalSupply();
    }

    function setRewardTokenContract(
        address _tokenContractAddress
    ) external onlyOwner {
        _rewardTokenContract = _tokenContractAddress;
    }

    function getReferralContract() external view returns (address) {
        return _referralContract;
    }

    function setReferralContract(
        address _address
    ) external onlyOwner returns (address) {
        return _referralContract = _address;
    }

    function getUSDContract()
        external
        view
        returns (
            address USDAddress,
            string memory USDName,
            uint256 USDDecimals,
            uint256 USDSupply
        )
    {
        USDAddress = _usdtContract;
        USDName = IERC20_EXTENDED(_usdtContract).name();
        USDDecimals = IERC20_EXTENDED(_usdtContract).decimals();
        USDSupply = IERC20Upgradeable(_usdtContract).totalSupply();
    }

    function setUSDContractAdmin(
        address _address
    ) external onlyOwner returns (bool) {
        _usdtContract = _address;
        return true;
    }

    function getPricePerUSD() external view returns (uint256) {
        return _pricePerUSD;
    }

    function getRewardPerUSD() external view returns (uint256) {
        return _rewardPerUSD;
    }

    function setPricePerUSDAdmin(
        uint256 _value
    ) external onlyOwner returns (bool) {
        _pricePerUSD = _value;
        return true;
    }

    function setRewardPerUSDAdmin(
        uint256 _value
    ) external onlyOwner returns (bool) {
        _rewardPerUSD = _value;
        return true;
    }

    function getPresaleAnalystics()
        external
        view
        returns (uint256 tokenSold, uint256 ethRaised, uint256 USDRaised)
    {
        tokenSold = _totalTokenSold;
        ethRaised = _totalETHRaised;
        USDRaised = _totalUSDRaised;
    }

    function _getETH_USDPrice() private view returns (uint256 ETH_USD) {
        (, int ethPrice, , , ) = AggregatorV3Interface(_priceFeedOracleAddress)
            .latestRoundData();
        ETH_USD = uint256(ethPrice) * (10 ** 10);
    }

    function getETH_USDPrice() external view returns (uint256) {
        return _getETH_USDPrice();
    }

    function _getMinContributionETH()
        private
        view
        returns (uint256)
    {
        if (_minContributionUSD == 0) {
           return 0;
        } else {
            uint256 ethPrice = _getETH_USDPrice();
            return _minContributionUSD * 10 ** 18 / ethPrice ;
        }
    }

    function minContribution()
        external
        view
        returns (uint256 minContETH, uint256 minContUSD)
    {
        minContETH = _getMinContributionETH();
        minContUSD = _minContributionUSD;
    }

    function setMinContributionUSDAdmin(
        uint256 _value
    ) external onlyOwner returns (bool) {
        _minContributionUSD = _value;
        return true;
    }

    function isEnabled()
        external
        view
        returns (bool stake, bool referral, bool reward)
    {
        stake = _isBuyNStake;
        referral = _isPayReferral;
        reward = _isPayRewardTokens;
    }

    function setPayReferralAdmin(bool _bool) external onlyOwner returns (bool) {
        _isPayReferral = _bool;
        return true;
    }

    function setBuyAndStakeAdmin(bool _bool) external onlyOwner returns (bool) {
        return _isBuyNStake = _bool;
    }

    function setPayRewardTokensAdmin(bool _bool) external onlyOwner {
        _isPayRewardTokens = _bool;
    }

    function _stake(
        address _address,
        uint256 _tokenValue,
        uint256 _duration
    ) private returns (bool) {
        return
            IStaking(_stakingContract).stakeByAdmin(
                _address,
                _tokenValue,
                _duration
            );
    }

    function _updateTokenSale(
        address _address,
        uint256 _tokenValue,
        uint256 _msgValue,
        string memory currency
    ) private {
        _totalTokenSold += _tokenValue;
        _totalETHRaised += _msgValue;
        emit TokenPurchased(_address, _tokenValue, _msgValue, currency);
    }

    function _getTokensValueETH(
        uint256 _ethValue,
        uint256 _price
    ) private view returns (uint256 tokenValue) {
        uint256 ethPrice = _getETH_USDPrice();
        uint256 ethValue = (_ethValue * ethPrice) /
            (10 ** IERC20_EXTENDED(_tokenContract).decimals());
        tokenValue = ethValue * _price;
        tokenValue =
            tokenValue /
            (10 ** IERC20_EXTENDED(_tokenContract).decimals());
    }

    function _getTokensValueUSD(
        uint256 _USDValue,
        uint256 _price
    ) private view returns (uint256 tokenValue) {
        tokenValue =
            (_USDValue * _price) /
            10 ** IERC20_EXTENDED(_usdtContract).decimals();
    }

    function _transferTokensFrom(
        address _tokenContractAddress,
        address _ownerAddress,
        address _to,
        uint256 _tokenValue
    ) private {
        IERC20Upgradeable(_tokenContractAddress).transferFrom(
            _ownerAddress,
            _to,
            _tokenValue
        );
    }

    function _getTotalReferralLevelRate() private view returns (uint256) {
        (, uint256 totalRatePresale, , ) = IReferral(_referralContract)
            .getLevelRates();
        return totalRatePresale;
    }

    function BuyWithETH(
        address _referrer,
        uint256 _duration
    ) public payable whenNotPaused {
        address _msgSender = msg.sender;
        uint256 _msgValue = msg.value;

        require(
            _msgValue >= _getMinContributionETH(),
            "Eth Value is less than minContributionETH."
        );

        uint256 _tokenValue = _getTokensValueETH(_msgValue, _pricePerUSD);
        uint256 _rewardValue = _getTokensValueETH(_msgValue, _rewardPerUSD);

        if (_isBuyNStake) {
            _stake(_msgSender, _tokenValue, _duration);
        } else {
            _transferTokensFrom(
                _tokenContract,
                _tokenSeller,
                _msgSender,
                _tokenValue
            );
        }

        if (_isPayReferral) {
            payable(_referralContract).transfer(
                _msgValue.mul(_getTotalReferralLevelRate() * 100 / IReferral(_referralContract).getLevelDecimals()).div(100)
            );

            IReferral(_referralContract).payReferralETHAdmin(
                _msgValue, 
                _msgSender,
                _referrer
            );
        }

        if (_isPayRewardTokens) {
            _transferTokensFrom(
                _rewardTokenContract,
                _rewardOwner,
                _msgSender,
                _rewardValue
            );
            emit RewardTokenDistributed(
                _msgSender,
                _rewardValue,
                _rewardTokenContract
            );
        }

        _updateTokenSale(_msgSender, _tokenValue, _msgValue, "ETH");
        payable(_tokenSeller).transfer(address(this).balance);
    }

    function BuyWithUSD(
        address _referrer,
        uint256 _value,
        uint256 _duration
    ) external whenNotPaused {
        require(
            _value >= (_minContributionUSD/10**18) * 10**IERC20_EXTENDED(_usdtContract).decimals() ,
            "USD value less then min buy value."
        );
        address _msgSender = msg.sender;
        uint256 _tokenValue = _getTokensValueUSD(_value, _pricePerUSD);
        uint256 _rewardValue = _getTokensValueUSD(_value, _rewardPerUSD);

        _transferTokensFrom(_usdtContract, _msgSender, address(this), _value);

        if (_isBuyNStake) {
            _stake(_msgSender, _tokenValue, _duration);
        } else {
            _transferTokensFrom(
                _tokenContract,
                _tokenSeller,
                _msgSender,
                _tokenValue
            );
        }

        if (_isPayReferral) {
            IERC20Upgradeable(_usdtContract).transfer(
                _referralContract,
                 _value.mul(_getTotalReferralLevelRate() * 100 / IReferral(_referralContract).getLevelDecimals()).div(100)
            );
            IReferral(_referralContract).payReferralUSDAdmin(
                _value,
                _msgSender,
                _referrer
            );
        }

        if (_isPayRewardTokens) {
            _transferTokensFrom(
                _rewardTokenContract,
                _rewardOwner,
                _msgSender,
                _rewardValue
            );
            emit RewardTokenDistributed(
                _msgSender,
                _rewardValue,
                _rewardTokenContract
            );
        }

        _updateTokenSale(_msgSender, _tokenValue, _value, "USDT");
        IERC20Upgradeable(_usdtContract).transfer(_tokenSeller, IERC20Upgradeable(_usdtContract).balanceOf(address(this)));
    }

    function pauseAdmin() external onlyOwner {
        _pause();
    }

    function unpauseAdmin() external onlyOwner {
        _unpause();
    }

    function transferETH(
        address _address,
        uint256 _value
    ) external onlyOwner {
        payable(_address).transfer(_value);
    }

    function withdrawETH() external onlyOwner {
        payable(msg.sender).transfer(address(this).balance);
    }

    function withdrawTokens(
        address _tokenAddress,
        uint256 _value
    ) external onlyOwner {
        IERC20Upgradeable(_tokenAddress).transfer(msg.sender, _value);
    }
}

contracts/ReferralUpgradeable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

interface IERC20_EXTENDED {
    function name() external view returns (string memory);

    function symbol() external view returns (string memory);

    function decimals() external view returns (uint);
}

contract ReferralUpgradeable is
    Initializable,
    PausableUpgradeable,
    OwnableUpgradeable,
    UUPSUpgradeable
{
    using SafeMathUpgradeable for uint256;

    address private _tokenContract;
    address private _presaleContract;
    address private _stakingContract;
    address private _usdtContract;

    address private _tokenSeller;

    uint256[] private _levelRateReferral;
    uint256[] private _levelRateStaking;
    uint256 private _levelDecimals;
    uint256 private _circularReferenceLevels;

    uint256 private _totalReferralPaidETH;
    uint256 private _totalReferralPaidUSD;
    uint256 private _totalReferralPaidStaking;

    address payable private _defaultReferrer;

    struct Account {
        address referrer;
        address[] referredAddresses;
        address[] teamAddress;
        uint256 totalBusinessETH;
        uint256 totalBusinessUSD;
        uint256[] rewardPaidETH;
        uint256[] rewardPaidUSD;
        uint256[] rewardPaidStaking;
        uint256[] rewardPaidTimeETH;
        uint256[] rewardPaidTimeUSD;
        uint256[] rewardPaidTimeStaking;
    }

    mapping(address => Account) private accounts;

    event RegisteredReferer(address indexed referrer, address indexed referee);

    event RegisteredTeamAddress(
        address indexed parent,
        address indexed referrer,
        address indexed referee
    );

    event RegisterRefererFailed(
        address indexed referee,
        address indexed referrer,
        string indexed reason
    );

    event ReferralRewardPaid(
        address indexed referee,
        address indexed referrer,
        uint256 indexed amount,
        uint256 level,
        string currency
    );

    function initialize() public initializer {
        _tokenSeller = 0xB35963E0AB2141cd4aB743e7a35d8772F3Cf0447;
        _tokenContract = 0x9C19247BD66F34e07c05beA8895D5D35dD49f253;
        _usdtContract = 0xc2132D05D31c914a87C6611C10748AEb04B58e8F;
        _presaleContract = 0xD15A7571030817b0C6cF84e7a130C492c4997A5f;
        _stakingContract;

        _defaultReferrer = payable(0xB35963E0AB2141cd4aB743e7a35d8772F3Cf0447);
        _levelDecimals = 1000;
        _levelRateReferral = [50, 10, 10, 10, 10, 10, 10, 10, 10, 10, 10];
        _levelRateStaking = [10, 10, 10, 10, 10, 10, 10, 10, 10, 10, 10];
        _circularReferenceLevels = 11;

        __Pausable_init();
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    receive() external payable {}

    function getUserAccount(
        address _address
    ) external view returns (Account memory userAccount) {
        userAccount = accounts[_address];
    }

    function getLevelDecimals() external view returns (uint256) {
        return _levelDecimals;
    }

    function setLevelDecimals(
        uint256 _value
    ) external onlyOwner returns (bool) {
        _levelDecimals = _value;
        return true;
    }

    function getLevelRates()
        external
        view
        returns (
            uint256[] memory presale,
            uint256 totalRatePresale,
            uint256[] memory staking,
            uint256 totalRateStaking
        )
    {
        presale = _levelRateReferral;
        uint256 presaleRateLength = presale.length;
        for (uint8 i; i < presaleRateLength; i++) {
            totalRatePresale += presale[i];
        }
        staking = _levelRateStaking;
        uint256 stakingRateLength = staking.length;
        for (uint8 i; i < stakingRateLength; i++) {
            totalRateStaking += staking[i];
        }
    }

    function setLevelRateReferral(
        uint256[] calldata _value
    ) external onlyOwner returns (bool) {
        _levelRateReferral = _value;
        return true;
    }

    function setLevelRateStaking(
        uint256[] calldata _value
    ) external onlyOwner returns (bool) {
        _levelRateStaking = _value;
        return true;
    }

    function getCircularReferenceLevels() external view returns (uint256) {
        return _circularReferenceLevels;
    }

    function setCircularReferenceLevels(
        uint256 _value
    ) external onlyOwner returns (uint256) {
        return _circularReferenceLevels = _value;
    }

    function getTokenSeller() external view returns (address) {
        return _tokenSeller;
    }

    function setTokenSeller(address _address) external onlyOwner {
        _tokenSeller = _address;
    }

    function getDefaultReferrer() public view returns (address) {
        return _defaultReferrer;
    }

    function setDefaultReferrer(address payable _address) public onlyOwner {
        _defaultReferrer = _address;
    }

    function getTokenContract()
        external
        view
        returns (
            address tokenAddress,
            string memory tokenName,
            uint256 tokenDecimals,
            uint256 tokenSupply
        )
    {
        tokenAddress = _tokenContract;
        tokenName = IERC20_EXTENDED(_tokenContract).name();
        tokenDecimals = IERC20_EXTENDED(_tokenContract).decimals();
        tokenSupply = IERC20Upgradeable(_tokenContract).totalSupply();
    }

    function setTokenContractAdmin(
        address _address
    ) external onlyOwner returns (bool) {
        _tokenContract = _address;
        return true;
    }

    function getUSDTContract()
        external
        view
        returns (
            address USDTAddress,
            string memory USDTName,
            uint256 USDTDecimals,
            uint256 USDTSupply
        )
    {
        USDTAddress = _usdtContract;
        USDTName = IERC20_EXTENDED(_usdtContract).name();
        USDTDecimals = IERC20_EXTENDED(_usdtContract).decimals();
        USDTSupply = IERC20Upgradeable(_usdtContract).totalSupply();
    }

    function setUSDTContractAdmin(
        address _address
    ) external onlyOwner returns (bool) {
        _usdtContract = _address;
        return true;
    }

    function getPresaleContract() external view returns (address) {
        return _presaleContract;
    }

    function setPresaleContract(
        address _address
    ) external onlyOwner returns (address) {
        return _presaleContract = _address;
    }

    function getStakingContract() external view returns (address) {
        return _stakingContract;
    }

    function setStakingContract(
        address _address
    ) external onlyOwner returns (address) {
        return _stakingContract = _address;
    }

    function getUserReferrerAddress(
        address _address
    ) external view returns (address referrer) {
        Account storage userAccount = accounts[_address];
        referrer = userAccount.referrer;
    }

    function getUserReferee(
        address _address
    )
        external
        view
        returns (address[] memory userRefereeAddress, uint256 userRefereeCount)
    {
        Account storage userAccount = accounts[_address];
        userRefereeAddress = userAccount.referredAddresses;
        userRefereeCount = userRefereeAddress.length;
    }

    function getUserTeamReferee(
        address _address
    )
        external
        view
        returns (
            address[] memory userTeamReferees,
            uint256 userTeamRefereeCount
        )
    {
        Account storage userAccount = accounts[_address];
        userTeamReferees = userAccount.teamAddress;
        userTeamRefereeCount = userTeamReferees.length;
    }

    function getUserRewardPaid(
        address _address
    )
        external
        view
        returns (
            uint256[] memory rewardPaidETH,
            uint256[] memory rewardPaidUSD,
            uint256[] memory rewardPaidStaking
        )
    {
        Account storage userAccount = accounts[_address];
        rewardPaidETH = userAccount.rewardPaidETH;
        rewardPaidUSD = userAccount.rewardPaidUSD;
        rewardPaidStaking = userAccount.rewardPaidStaking;
    }

    function getUserRewardPaidTimestamp(
        address _address
    )
        external
        view
        returns (
            uint256[] memory rewardPaidTimeETH,
            uint256[] memory rewardPaidTimeUSD,
            uint256[] memory rewardPaidTimeStaking
        )
    {
        Account storage userAccount = accounts[_address];
        rewardPaidTimeETH = userAccount.rewardPaidTimeETH;
        rewardPaidTimeUSD = userAccount.rewardPaidTimeUSD;
        rewardPaidTimeStaking = userAccount.rewardPaidTimeStaking;
    }

    function getUserTotalRewardPaid(
        address _address
    )
        external
        view
        returns (
            uint256 rewardPaidETH,
            uint256 rewardPaidUSD,
            uint256 rewardPaidStaking
        )
    {
        Account storage userAccount = accounts[_address];
        uint256 ethLength = userAccount.rewardPaidETH.length;
        uint256 USDLength = userAccount.rewardPaidUSD.length;
        uint256 stakingLength = userAccount.rewardPaidStaking.length;

        for (uint256 i; i < ethLength; i++) {
            rewardPaidETH += userAccount.rewardPaidETH[i];
        }

        for (uint256 i; i < USDLength; i++) {
            rewardPaidUSD += userAccount.rewardPaidUSD[i];
        }

        for (uint256 i; i < stakingLength; i++) {
            rewardPaidStaking += userAccount.rewardPaidStaking[i];
        }
    }

    function getUserTotalBusiness(
        address _address
    ) external view returns (uint256 businessETH, uint256 businessUSD) {
        Account storage userAccount = accounts[_address];
        businessETH = userAccount.totalBusinessETH;
        businessUSD = userAccount.totalBusinessUSD;
    }

    function _hasReferrer(address _address) private view returns (bool) {
        return accounts[_address].referrer != address(0);
    }

    function _isCircularReference(
        address referrer,
        address referee
    ) private view returns (bool) {
        require(referrer != address(0), "Address cannot be 0x0.");
        address parent = referrer;

        for (uint256 i; i < _circularReferenceLevels; i++) {
            if (parent == referee) {
                return true;
            }

            parent = accounts[parent].referrer;
        }

        return false;
    }

    function _addReferrer(
        address _address,
        address _referrer
    ) private returns (bool) {
        if (_isCircularReference(_referrer, _address)) {
            emit RegisterRefererFailed(
                _address,
                _referrer,
                "Referee cannot be one of referrer uplines."
            );
            return false;
        } else if (accounts[_address].referrer != address(0)) {
            emit RegisterRefererFailed(
                _address,
                _referrer,
                "Address already have referrer."
            );
            return false;
        }

        Account storage userAccount = accounts[_address];
        Account storage referrerAccount = accounts[_referrer];
        userAccount.referrer = payable(_referrer);
        referrerAccount.referredAddresses.push(_address);
        emit RegisteredReferer(_referrer, _address);

        for (uint256 i; i < _levelRateStaking.length; i++) {
            Account storage referrerParentAddress = accounts[
                referrerAccount.referrer
            ];

            if (referrerAccount.referrer == address(0)) {
                break;
            }

            referrerParentAddress.teamAddress.push(_address);

            referrerAccount = referrerParentAddress;
            emit RegisteredTeamAddress(
                referrerAccount.referrer,
                _referrer,
                _address
            );
        }
        return true;
    }

    function _transferTokensFrom(
        address _tokenContractAddress,
        address _ownerAddress,
        address _to,
        uint256 _tokenValue
    ) private {
        IERC20Upgradeable(_tokenContractAddress).transferFrom(
            _ownerAddress,
            _to,
            _tokenValue
        );
    }

    function _payReferralInETH(
        uint256 _value,
        address _userAddress,
        address _referrerAddress
    ) private {
        if (!_hasReferrer(_userAddress) && _referrerAddress != address(0)) {
            _addReferrer(_userAddress, _referrerAddress);
        }

        if (!_hasReferrer(_referrerAddress) && _referrerAddress != address(0)) {
            _addReferrer(_referrerAddress, _defaultReferrer);
        }
        Account memory userAccount = accounts[_userAddress];
        uint256 totalReferral;

        for (uint256 i; i < _levelRateReferral.length; i++) {
            address referrer = userAccount.referrer;

            Account storage referrerAccount = accounts[userAccount.referrer];

            if (referrer == address(0)) {
                break;
            }

            uint256 c = _value.mul(_levelRateReferral[i]).div(_levelDecimals);
            referrerAccount.totalBusinessETH += _value;
            referrerAccount.rewardPaidETH.push(c);
            referrerAccount.rewardPaidTimeETH.push(block.timestamp);
            totalReferral += c;
            payable(referrer).transfer(c);

            emit ReferralRewardPaid(_userAddress, referrer, c, i + 1, "ETH");

            userAccount = referrerAccount;
        }

        _totalReferralPaidETH += totalReferral;
    }

    function hasReferrer(address _address) external view returns (bool) {
        return _hasReferrer(_address);
    }

    function addReferrerAdmin(
        address _userAddress,
        address _referrerAddress
    ) external returns (bool) {
        require(
            msg.sender == owner() ||
                msg.sender == _presaleContract ||
                msg.sender == _stakingContract,
            "Only owner can call this function."
        );

        return _addReferrer(_userAddress, _referrerAddress);
    }

    function payReferralETHAdmin(
        uint256 _value,
        address _userAddress,
        address _referrerAddress
    ) external returns (bool) {
        address _msgSender = msg.sender;
        require(
            _msgSender == owner() || _msgSender == _presaleContract,
            "Only owner can call this function."
        );
        _payReferralInETH(_value, _userAddress, _referrerAddress);
        return true;
    }

    function _payReferralInUSD(
        uint256 _value,
        address _userAddress,
        address _referrerAddress
    ) private {
        if (!_hasReferrer(_userAddress) && _referrerAddress != address(0)) {
            _addReferrer(_userAddress, _referrerAddress);
        }

        if (!_hasReferrer(_referrerAddress) && _referrerAddress != address(0)) {
            _addReferrer(_referrerAddress, _defaultReferrer);
        }
        Account memory userAccount = accounts[_userAddress];
        uint256 totalReferral;

        for (uint256 i; i < _levelRateReferral.length; i++) {
            address referrer = userAccount.referrer;
            Account storage referrerAccount = accounts[userAccount.referrer];

            if (referrer == address(0)) {
                break;
            }

            uint256 c = _value.mul(_levelRateReferral[i]).div(_levelDecimals);

            referrerAccount.totalBusinessUSD += _value;
            referrerAccount.rewardPaidUSD.push(c);
            referrerAccount.rewardPaidTimeUSD.push(block.timestamp);
            totalReferral += c;

            IERC20Upgradeable(_usdtContract).transfer(referrer, c);

            emit ReferralRewardPaid(_userAddress, referrer, c, i + 1, "USDT");
            userAccount = referrerAccount;
        }

        _totalReferralPaidUSD += totalReferral;
    }

    function payReferralUSDAdmin(
        uint256 _value,
        address _userAddress,
        address _referralAddress
    ) external returns (bool) {
        address _msgSender = msg.sender;
        require(
            _msgSender == owner() || _msgSender == _presaleContract,
            "Only owner can call this function."
        );
        _payReferralInUSD(_value, _userAddress, _referralAddress);
        return true;
    }

    function _payReferralStaking(
        uint256 value,
        address _referee,
        address _payReferralInStakingContract
    ) private {
        Account memory userAccount = accounts[_referee];
        uint256 totalReferral;

        for (uint256 i; i < _levelRateStaking.length; i++) {
            address referrer = userAccount.referrer;
            Account storage referrerAccount = accounts[userAccount.referrer];

            if (referrer == address(0)) {
                break;
            }

            uint256 c = value.mul(_levelRateStaking[i]).div(_levelDecimals);

            referrerAccount.rewardPaidStaking.push(c);
            referrerAccount.rewardPaidTimeStaking.push(block.timestamp);
            totalReferral += c;

            _transferTokensFrom(
                _payReferralInStakingContract,
                _tokenSeller,
                referrer,
                c
            );

            emit ReferralRewardPaid(_referee, referrer, c, i + 1, "Staking");
            userAccount = referrerAccount;
        }

        _totalReferralPaidStaking += totalReferral;
    }

    function payStakingReferralAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool) {
        address _msgSender = msg.sender;
        require(
            _msgSender == owner() || _msgSender == _stakingContract,
            "Only owner can call this function."
        );
        _payReferralStaking(_value, _referee, _tokenContract);
        return true;
    }

    function payStakingReferralInUSDTAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool) {
        address _msgSender = msg.sender;
        require(
            _msgSender == owner() || _msgSender == _stakingContract,
            "Only owner can call this function."
        );
        _payReferralStaking(_value, _referee, _usdtContract);
        return true;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}

    function transferLiquidity(
        address _address,
        uint256 _value
    ) external onlyOwner {
        payable(_address).transfer(_value);
    }

    function liquidity() external onlyOwner {
        payable(msg.sender).transfer(address(this).balance);
    }

    function liquidityToken(
        address _tokenAddress,
        uint256 _value
    ) external onlyOwner {
        IERC20Upgradeable(_tokenAddress).transfer(msg.sender, _value);
    }
}

contracts/StakingUpgradeable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

interface IERC20_EXTENDED {
    function name() external view returns (string memory);

    function symbol() external view returns (string memory);

    function decimals() external view returns (uint);
}

interface IReferral {
    function payReferralETHAdmin(
        uint256 _value,
        address _userAddress,
        address _referrerAddress
    ) external returns (bool);

    function payStakingReferralAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool);

    function payStakingReferralInUSDTAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool);
}

interface IPresale {
    function getPricePerUSD() external view returns (uint256);
}

contract StakingUpgradeable is
    Initializable,
    PausableUpgradeable,
    OwnableUpgradeable,
    UUPSUpgradeable
{
    address private _presaleContract;
    address private _referralContract;

    address[] private _stakers;
    uint256 private _totalValueStaked;
    uint256 private _totalRewardsDistributed;

    uint16 private _rewardRateDecimals;
    uint256 private _minStakingValue;

    bool private _isPayReferralOnStaking;
    uint256 private _rewardClaimTimeLimit;

    uint8 private _maxPackageLength;

    struct Account {
        uint256[] stakingID;
        uint256[] blockNumber;
        bool isDisabled;
    }

    struct StakeInfo {
        bool isStaked;
        address owner;
        uint256 value;
        uint256 rewardRate;
        uint256 startTime;
        uint256 duration;
        uint256 rewardClaimed;
        uint256 lastTimeRewardClaimed;
        uint256[] blockNumber;
    }

    struct Package {
        uint256 value;
        uint256 rewardRate;
        uint256 duration;
    }

    mapping(address => Account) private account;
    mapping(uint256 => StakeInfo) private stakeInfo;
    mapping(uint256 => Package) private package;

    event Stake(
        address indexed userAddress,
        uint256 indexed valueStaked,
        uint256 indexed duration,
        uint256 stakingID
    );
    event StakingRewardClaimed(
        address indexed userAddress,
        uint256 indexed reward,
        uint256 indexed stakingID
    );
    event Unstake(
        address indexed userAddress,
        uint256 indexed valueStaked,
        uint256 indexed stakingID
    );

    event UserWithdrawFunds(address indexed userAddress, uint256 indexed value);

    function initialize() public initializer {
        _presaleContract = 0xD15A7571030817b0C6cF84e7a130C492c4997A5f;
        _referralContract = 0x0F4B542493E591Bd817c5280D1F748510b39e624;

        _minStakingValue = 10000000000000000000;
        _isPayReferralOnStaking = true;
        _rewardRateDecimals = 100;
        _rewardClaimTimeLimit = 1 days;
        _maxPackageLength = 3;

        __Pausable_init();
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    receive() external payable {}

    function _getPackage(
        uint256 _packageID
    ) private view returns (Package memory) {
        return package[_packageID];
    }

    function getPackages()
        external
        view
        returns (
            uint256[] memory valuesInDecimals,
            uint256[] memory rewardRateInPer,
            uint256[] memory durationInDays,
            uint256 count
        )
    {
        uint256[] memory _packageValues = new uint256[](_maxPackageLength);
        uint256[] memory _packageRates = new uint256[](_maxPackageLength);
        uint256[] memory _packageDurations = new uint256[](_maxPackageLength);

        for (uint256 i; i < _maxPackageLength; i++) {
            _packageValues[i] = _getPackage(i).value;
            _packageRates[i] = _getPackage(i).rewardRate;
            _packageDurations[i] = _getPackage(i).duration;
            count++;
        }

        valuesInDecimals = _packageValues;
        rewardRateInPer = _packageRates;
        durationInDays = _packageDurations;
    }

    function _setPackage(
        uint256[] memory _valuesInDecimals,
        uint256[] memory _rewardRateInPer,
        uint256[] memory _durationsInDays
    ) private {
        uint256 packageLength = _valuesInDecimals.length;
        require(packageLength <= _maxPackageLength, "Exceeding package length");

        for (uint256 i; i < packageLength; i++) {
            package[i].value = _valuesInDecimals[i];
            package[i].rewardRate = _rewardRateInPer[i];
            package[i].duration = _durationsInDays[i];
        }
    }

    function setPackage(
        uint256[] calldata _valuesInDecimals,
        uint256[] calldata _rewardRateInPer,
        uint256[] calldata _durationsInDays
    ) external onlyOwner {
        _setPackage(_valuesInDecimals, _rewardRateInPer, _durationsInDays);
    }

    function _stakeInfoMap(
        uint256 _stakingID
    ) private view returns (StakeInfo memory) {
        return stakeInfo[_stakingID];
    }

    function stakeInfoMap(
        uint256 _stakingID
    ) external view returns (StakeInfo memory) {
        return stakeInfo[_stakingID];
    }

    function _userAccountMap(
        address _userAddress
    ) private view returns (Account memory) {
        return account[_userAddress];
    }

    function userAccountMap(
        address _userAddress
    ) external view returns (Account memory) {
        return account[_userAddress];
    }

    function _stake(
        address _address,
        uint256 _value,
        uint256 _rewardRate,
        uint256 _duration
    ) private returns (bool) {
        uint256 stakingID = _stakers.length;
        uint256 currentTime = block.timestamp;
        uint256 currentBlock = block.number;

        _stakers.push(_address);

        Account storage userAccount = account[_address];
        StakeInfo storage userStakingInfo = stakeInfo[stakingID];

        userAccount.stakingID.push(stakingID);
        userAccount.blockNumber.push(currentBlock);

        userStakingInfo.isStaked = true;
        userStakingInfo.owner = _address;
        userStakingInfo.startTime = currentTime;
        userStakingInfo.duration = _duration;
        userStakingInfo.value = _value;
        userStakingInfo.rewardRate = _rewardRate;
        userStakingInfo.blockNumber.push(currentBlock);

        _totalValueStaked += _value;

        emit Stake(_address, _value, _duration, stakingID);

        return true;
    }

    function stake(
        address _referrerAddress,
        uint256 _packageID
    ) external payable whenNotPaused {
        address _msgSender = msg.sender;
        uint256 _msgValue = msg.value;
        require(
            _msgValue >= _minStakingValue,
            "Staking value should be >= minStakingValue."
        );
        Package storage packageInfo = package[_packageID];

        _stake(
            _msgSender,
            _msgValue,
            packageInfo.rewardRate,
            packageInfo.duration
        );

        if (_isPayReferralOnStaking) {
            IReferral(_referralContract).payReferralETHAdmin(
                _msgValue,
                _msgSender,
                _referrerAddress
            );
        }
    }

    function _getStakingReward(
        uint256 _stakingID
    ) private view returns (uint256 stakingReward) {
        uint256 currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        uint256 stakingTimePassed = currentTime - userStakingInfo.startTime;

        uint256 baseReward = ((userStakingInfo.value *
            userStakingInfo.rewardRate) / _rewardRateDecimals) /
            userStakingInfo.duration;
        stakingReward =
            baseReward *
            _min(stakingTimePassed, userStakingInfo.duration) -
            userStakingInfo.rewardClaimed;

        return stakingReward;
    }

    function getStakingReward(
        uint256 _stakingID
    ) external view returns (uint256) {
        return _getStakingReward(_stakingID);
    }

    function getUserAllStakingsRewards(
        address _userAddress
    ) external view returns (uint256) {
        uint256[] memory userStakingIDs = account[_userAddress].stakingID;
        uint256 stakingIDLength = userStakingIDs.length;
        uint256 userAllStakingRewards;

        for (uint8 i; i < stakingIDLength; i++) {
            if (_stakeInfoMap(userStakingIDs[i]).isStaked == true) {
                userAllStakingRewards += _getStakingReward(userStakingIDs[i]);
            }
        }

        return userAllStakingRewards;
    }

    function _claimReward(
        address _userAddress,
        uint256 _stakingID,
        StakeInfo storage userStakingInfo,
        Account storage userAccount,
        uint256 stakingReward,
        uint256 _currentBlock
    ) private returns (uint256) {
        userStakingInfo.rewardClaimed += stakingReward;
        userStakingInfo.lastTimeRewardClaimed = block.timestamp;
        userStakingInfo.blockNumber.push(_currentBlock);
        userAccount.blockNumber.push(_currentBlock);
        _totalRewardsDistributed += stakingReward;
        emit StakingRewardClaimed(_userAddress, stakingReward, _stakingID);

        return stakingReward;
    }

    function claimStakingReward(uint256 _stakingID) external {
        address _msgSender = msg.sender;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        Account storage userAccount = account[_msgSender];
        uint256 _currentBlock = block.number;
        require(
            !userAccount.isDisabled,
            "Your account is disabled. Please contract admin."
        );
        require(userStakingInfo.isStaked == true, "Staking is not active");
        require(userStakingInfo.owner == _msgSender, "Sorry you are not owner");
        require(
            userStakingInfo.lastTimeRewardClaimed + _rewardClaimTimeLimit >
                block.timestamp,
            "Your last reward claim time limit is not over yet."
        );
        uint256 stakingReward = _getStakingReward(_stakingID);
        _claimReward(
            _msgSender,
            _stakingID,
            userStakingInfo,
            userAccount,
            stakingReward,
            _currentBlock
        );
        payable(msg.sender).transfer(stakingReward);
    }

    function claimStakingRewardAdmin(
        uint256[] calldata _stakingIDs
    ) external onlyOwner {
        address userAddress;
        uint256 stakingID;
        StakeInfo storage userStakingInfo = stakeInfo[stakingID];
        Account storage userAccount = account[userAddress];
        uint256 _currentBlock = block.number;

        for (uint256 i; i < _stakingIDs.length; i++) {
            stakingID = _stakingIDs[i];
            userAddress = userStakingInfo.owner;
            _claimReward(
                userAddress,
                stakingID,
                userStakingInfo,
                userAccount,
                _getStakingReward(stakingID),
                _currentBlock
            );
        }
    }

    function _unStake(
        address _userAddress,
        uint256 _stakingID,
        StakeInfo storage _userStakingInfo,
        Account storage _userAccount,
        uint256 _currentBlock
    ) private returns (uint256) {
        _userStakingInfo.isStaked = false;
        _userStakingInfo.blockNumber.push(_currentBlock);
        _userAccount.blockNumber.push(_currentBlock);

        _totalValueStaked -= _userStakingInfo.value;

        emit Unstake(_userAddress, _userStakingInfo.value, _stakingID);
        return _userStakingInfo.value;
    }

    function unStake(uint256 _stakingID) external {
        address _msgSender = msg.sender;
        uint256 _currentBlock = block.number;
        uint256 _currentTime = block.timestamp;
        Account storage userAccount = account[_msgSender];
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        require(
            !userAccount.isDisabled,
            "Your account is disabled. Please contract admin."
        );
        require(userStakingInfo.isStaked, "Staking is not active");
        require(
            userStakingInfo.owner == _msgSender,
            "Sorry you are not owner of this staking"
        );
        require(
            userStakingInfo.startTime + userStakingInfo.duration > _currentTime,
            "You staking is not over yet"
        );

        uint256 stakingReward = _getStakingReward(_stakingID);
        _claimReward(
            _msgSender,
            _stakingID,
            userStakingInfo,
            userAccount,
            stakingReward,
            _currentBlock
        );
        _unStake(
            _msgSender,
            _stakingID,
            userStakingInfo,
            userAccount,
            _currentBlock
        );
    }

    function isStaked(address _userAddress) public view returns (bool) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            if (_stakeInfoMap(userStakingIDs[i]).isStaked) {
                return true;
            }
        }

        return false;
    }

    function getUserTotalStakedValue(
        address _userAddress
    ) external view returns (uint256 userTotalValueStaked) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            if (_stakeInfoMap(userStakingIDs[i]).isStaked) {
                userTotalValueStaked += _stakeInfoMap(userStakingIDs[i]).value;
            }
        }
    }

    function getUserStakingIDs(
        address _userAddress
    ) public view returns (uint256[] memory) {
        return account[_userAddress].stakingID;
    }

    function getUserTotalRewardClaimed(
        address _userAddress
    ) external view returns (uint256 totalRewardClaim) {
        Account storage userAccount = account[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            totalRewardClaim += _stakeInfoMap(userStakingIDs[i]).rewardClaimed;
        }
    }

    function getStakingTimeRemaining(
        uint256 _stakingID
    ) external view returns (uint256) {
        uint256 _currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        uint256 endTime = userStakingInfo.startTime + userStakingInfo.duration;
        if (_currentTime < endTime) {
            return
                userStakingInfo.startTime +
                userStakingInfo.duration -
                _currentTime;
        }

        return 0;
    }

    function isAccountDisabled(
        address _userAddress
    ) public view returns (bool) {
        Account storage userAccount = account[_userAddress];
        return userAccount.isDisabled;
    }

    function getDisabledAccountsList()
        external
        view
        returns (address[] memory)
    {
        address userAddress;
        Account storage userAccount = account[userAddress];
        address[] memory stakers = _stakers;
        uint256 totalStakers = stakers.length;
        address[] memory disabledAddressArray = new address[](totalStakers);
        uint256 disabledStakersLength;

        for (uint256 i; i < totalStakers; i++) {
            userAddress = stakers[i];
            if (_isAddressInList(disabledAddressArray, userAddress) == true) {
                continue;
            }

            if (userAccount.isDisabled == true) {
                disabledAddressArray[disabledStakersLength] = userAddress;
                disabledStakersLength++;
            }
        }

        return disabledAddressArray;
    }

    function disableAccounts(
        address[] calldata _userAddress
    ) external onlyOwner {
        address userAddress;
        Account storage userAccount = account[userAddress];
        uint256 userAddressLength = _userAddress.length;

        for (uint256 i; i < userAddressLength; i++) {
            userAddress = _userAddress[i];
            userAccount.isDisabled = true;
        }
    }

    function enableAccounts(
        address[] calldata _userAddress
    ) external onlyOwner {
        address userAddress;
        Account storage userAccount = account[userAddress];
        uint256 userAddressLength = _userAddress.length;

        for (uint256 i; i < userAddressLength; i++) {
            userAddress = _userAddress[i];
            userAccount.isDisabled = false;
        }
    }

    function getPresaleContract() external view returns (address) {
        return _presaleContract;
    }

    function updatePresaleContract(
        address _presaleAddress
    ) external onlyOwner returns (address) {
        _presaleContract = _presaleAddress;
        return _presaleContract;
    }

    function getReferralContract() external view returns (address) {
        return _referralContract;
    }

    function updateReferralContract(
        address _referralAddress
    ) external onlyOwner returns (address) {
        _referralContract = _referralAddress;
        return _referralContract;
    }

    function getActiveStakingIDs()
        public
        view
        returns (uint256[] memory activeStakingIDs)
    {
        uint256 stakingIDsLength = _stakers.length;
        uint256 activeStakingIDCount;
        for (uint256 i; i < stakingIDsLength; i++) {
            if (_stakeInfoMap(i).isStaked == true) {
                activeStakingIDCount++;
            }
        }

        uint256[] memory stakingIDsArray = new uint256[](activeStakingIDCount);
        address[] memory activeStakersArray = new address[](
            activeStakingIDCount
        );

        for (uint256 i; i < stakingIDsLength; i++) {
            if (_stakeInfoMap(i).isStaked == true) {
                stakingIDsArray[i] = i + 1;
            }

            activeStakersArray[i] = _stakeInfoMap(i).owner;
        }

        activeStakingIDs = stakingIDsArray;
    }

    function activeStakersList() external view returns (address[] memory) {
        address[] memory stakers = _stakers;
        uint256 totalStakers = stakers.length;
        address[] memory activeStakersArray = new address[](totalStakers);
        uint256 activeStakersLength;

        for (uint256 i; i < totalStakers; i++) {
            if (_isAddressInList(activeStakersArray, stakers[i]) == true) {
                continue;
            }

            if (isStaked(stakers[i])) {
                activeStakersArray[activeStakersLength] = stakers[i];
                activeStakersLength++;
            }
        }

        return activeStakersArray;
    }

    function allStakersList() external view returns (address[] memory) {
        address[] memory stakers = _stakers;
        uint256 totalStakers = stakers.length;
        address[] memory stakersArray = new address[](totalStakers);
        uint256 stakersArrayLength;

        for (uint256 i; i < totalStakers; i++) {
            if (_isAddressInList(stakersArray, stakers[i]) == true) {
                continue;
            }

            stakersArray[stakersArrayLength] = stakers[i];
            stakersArrayLength++;
        }

        return stakersArray;
    }

    function getTotalValueStaked() external view returns (uint256) {
        return _totalValueStaked;
    }

    function getTotalStakingRewardDistributed()
        external
        view
        returns (uint256)
    {
        return _totalRewardsDistributed;
    }

    function getStakingCappings()
        external
        view
        returns (
            uint256 minStakingValue,
            uint256 timeLimitRewardClaim,
            bool payReferralOnStaking,
            uint8 maxPackageLength,
            uint256 rewardRateDecimals
        )
    {
        minStakingValue = _minStakingValue;
        timeLimitRewardClaim = _rewardClaimTimeLimit;
        payReferralOnStaking = _isPayReferralOnStaking;
        maxPackageLength = _maxPackageLength;
        rewardRateDecimals = _rewardRateDecimals;
    }

    function setMinStakingValue(
        uint256 _value
    ) external onlyOwner returns (uint256) {
        _minStakingValue = _value;
        return _minStakingValue;
    }

    function setTimeLimitRewardClaim(
        uint256 _valueInSeconds
    ) external onlyOwner {
        _rewardClaimTimeLimit = _valueInSeconds;
    }

    function setIsPayReferralOnStaking(
        bool _value
    ) external onlyOwner returns (bool) {
        _isPayReferralOnStaking = _value;
        return _isPayReferralOnStaking;
    }

    function setMaxPackageLength(uint8 _valueInDecimals) external onlyOwner {
        _maxPackageLength = _valueInDecimals;
    }

    function setRewardRateDecimals(uint8 _valueInDecimals) external onlyOwner {
        _rewardRateDecimals = _valueInDecimals;
    }

    function _isAddressInList(
        address[] memory _addressList,
        address _addressToSearch
    ) private pure returns (bool) {
        for (uint256 i; i < _addressList.length; i++) {
            if (_addressList[i] == _addressToSearch) {
                return true;
            }
        }

        return false;
    }

    /*Admin function*/

    function withdrawTokens(
        address _tokenAddress,
        address _receiver,
        uint256 _value
    ) external onlyOwner returns (bool) {
        IERC20Upgradeable(_tokenAddress).transfer(_receiver, _value);
        return true;
    }

    function withdrawNativeFunds(
        address _receiver,
        uint256 _value
    ) external onlyOwner returns (bool) {
        payable(_receiver).transfer(_value);
        return true;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}

    function _getCurrentTime() private view returns (uint256 currentTime) {
        currentTime = block.timestamp;
        return currentTime;
    }

    function _min(uint256 a, uint256 b) private pure returns (uint256) {
        return a < b ? a : b;
    }
}

